def factorize(n: int) -> List[int]:
    if n == 0:
        return []
    factors = []
    if n < 0:
        n = -n
    while n % 2 == 0:
        factors.append(2)
        n //= 2
    i = 3
    while i * i <= n:
        while n % i == 0:
            factors.append(i)
            n //= i
        i += 2
    if n > 1:
        factors.append(n)
    return factors

