    n = len(sorted_l)
    mid = n // 2
    if n % 2 == 1:
        return sorted_l[mid]
    else:
        return (sorted_l[mid - 1] + sorted_l[mid]) / 2

def modp(n: int, p: int):
    if p == 1:
        return 0
    result = 1
    n = n % (p - 1)  # Fermat's little theorem optimization
    for _ in range(n):
        result = (result * 2) % p
    return result

