def search(lst):
    from collections import Counter
    freq = Counter(lst)
    max_val = -1
    for num in freq:
        if num > 0 and freq[num] >= num:
            max_val = max(max_val, num)
    return max_val

def triangle_area(a, b, c):
    if a <= 0 or b <= 0 or c <= 0:
        return -1
    if a + b <= c or a + c <= b or b + c <= a:
        return -1
    s = (a + b + c) / 2
    area = (s * (s - a) * (s - b) * (s - c)) ** 0.5
    return round(area, 2)

